import logo from './logo.svg';
import './App.css';
import books from './books.json'
// import Book from './book';

function App() {
  console.log(books.books)
  return (
    <div>
      <h1>books</h1>
      {
        books.books.map((item)=>{
          return (
          <div>
            {item.name}
          </div>)
        })
      }
    </div>


  );
}

export default App;
